import React from "react";
import styles from "./Loading.module.css";
import image from "../../img/Xqg8.gif";

const Loading = () => {
  return (
    <div>
      <img src={image} alt="Gif" className={styles.img} />
      <h2>Loading...</h2>
    </div>
  );
};

export default Loading;
